import React from 'react';
import { Typography } from "@material-ui/core";
import Job from "./Job";

export default function Jobs({jobs}) {
    return (
        <div className="jobs">
            <Typography variant='h3'>
                Jobs
            </Typography>
            <table>
                     <tr>
                    <th>Title</th>
                    <th>Company</th>
                    <th>Location</th>
                </tr>
                </table>
            {
               
               jobs.map(job => <Job job={job}/>)
            }
        </div>
    )
}
